import "./Patient.css";

const Patient = (props) => {
   const patientData = props.patientData;
   const firstName = patientData[0].patient_name.split(" ")[0];
   return (
      <div className="patient-container">
         <h2>Hello, {firstName}</h2>
         <p>Your patient code is: {patientData[0].patient_code}</p>
         <p>Your patient code is: {patientData[0].patient_code}</p>
      </div>
   );
};

export default Patient;
